import React from 'react';
import './Dashboard.css'; // Make sure this CSS file exists and is linked correctly

const Dashboard = () => {
  return (
    <div className="dashboard-container">
      <h1 className="dashboard-title">OVERVIEW</h1>
      <div className="dashboard-content">
        <div className="dashboard-section priority-tasks">
          <h2>PRIORITY TASKS</h2>
          {/* Components for priority tasks */}
        </div>
        <div className="dashboard-section task-analytics">
          <h2>TASK ANALYTICS</h2>
          {/* Components for task analytics */}
        </div>
        <div className="dashboard-section calendar">
          <h2>CALENDAR</h2>
          {/* Components for calendar */}
        </div>
        <div className="dashboard-section reports-button">
          <button>View reports here</button>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
